import ReactDOM from 'react-dom/client';

import './index.css';
import App from './App';

ReactDOM.render(
    <React.StrictMode>
      <Provider store={store}>
        <App />
      </Provider>
    </React.StrictMode>,
    document.getElementById('root')
  );

